classDiagram
    class App {
        -Flask app
        +create_app() Flask
    }
    class Tenant {
        -id: int
        -name: str
        -url: str
        -s3_bucket: str
        +__init__(id: int, name: str, url: str, s3_bucket: str)
    }
    class User {
        -id: int
        -username: str
        -password_hash: str
        +__init__(id: int, username: str, password_hash: str)
        +set_password(password: str)
        +check_password(password: str) bool
    }
    class ValidationService {
        +validate_data(data: dict) bool
    }
    class Auth {
        +login(username: str, password: str) bool
        +logout() None
    }
    App --> Tenant
    App --> User
    App --> ValidationService
    App --> Auth
